description: >-
  A tavasz első fiestáján, március 14-én újra találkozunk! 😊

  Gyere, táncolj te is a város legjobb latin partyján!


  Tánciskolától függetlenül jöhetsz, itt biztosan megtalálod a neked megfelelő zenét. Legyen az pörgősebb salsa, timba, vagy bújósabb bachata, biztosan a legfrissebb slágerekkel várunk. 


  Kiváló zenei válogatás, jó hangulat, tánchoz alkalmas padlózat, csúcsminőségű fény -és hangtechnika vár rád, egyszóval minden adott egy remek táncos estéhez.


  Belépő: 2000,- Ft 


  Smooth timbák, modern sonok, classik casinók szólnak majd, melyeket megfűszerezünk csipet bachatával, leheletnyi reggaetonnal és merenguével.


  Tehát a hangulat garantált!

  A főszerepben mint minden pénteken, most is Kuba és Dominika!


  💙🤍❤️💙🤍❤️💙🤍❤️💙🤍❤️

  EZ HIGGYÉTEK EL, ÉLMÉNY LESZ!!!


